    false,nt"url": null,nt"notes": "This annual narrative report for Ottawa
    National Wildlife Refuge Complex outlines Refuge accomplishments during the 1995
    calendar year.  The report begins with a summary of the year's highlights and weather
    conditions. Land acquisition is covered. The report includes a planning section
    which discusses research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, volunteer programs, funding, and safety
    is given. Habitat management is also covered; subjects include wetlands, forests,
    croplands, grasslands, pest control, and private lands. The wildlife section of
    the report discusses wildlife diversity, endangered and threatened species, waterfowl,
    marsh birds and waterbirds, shorebirds, raptors, game mammals, and animal control.
    The public uses of the Refuge described in this report include interpretive programs,
    hunting, fishing, trapping, wildlife observation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    rehabilitation, equipment replacement, and computer systems. Cooperative programs
    are provided at the end.",nt"license_title": "License Not Specified",nt"extras":
